import './Reviews.css';

import GoogleReviews from '../ReviewFetcher';

const Reviews = () => {

  const reviewList = (reviews) => {
    reviews.forEach(review => {
      return (
        <div className='reviews-container'>
          <p>{review.author_title}</p>
        </div>
      )
    });
  }

  return (
    reviewList(reviews.data)
  )
  return (
    <>
    <h2>Reviews</h2>
    <GoogleReviews />
    </>
  );
};

export default Reviews;
